let currentSort = { key: null, asc: true };
let hiddenCols = new Set();

function fmtNumber(x) {
  if (x === null || x === undefined || x === "") return "";
  if (typeof x === "number") return x.toLocaleString();
  const n = Number(x.toString().replace(/,/g, ""));
  if (!Number.isNaN(n) && x !== "") return n.toLocaleString();
  return x;
}

function guessDefaultSortKey() {
  const candidates = ["후원", "개수", "금액", "count", "sum", "총"];
  const col = COLUMNS.find(c => candidates.some(k => c.toLowerCase().includes(k)));
  return col || COLUMNS[0];
}

function buildHeader() {
  const thead = document.querySelector("thead tr");
  thead.innerHTML = "";
  COLUMNS.forEach((col) => {
    if (hiddenCols.has(col)) return;
    const th = document.createElement("th");
    const span = document.createElement("span");
    span.textContent = col;
    const s = document.createElement("span");
    s.className = "sort";
    s.textContent = "";
    th.appendChild(span);
    th.appendChild(s);
    th.title = "정렬하려면 클릭";
    th.dataset.col = col;
    th.addEventListener("click", () => sortBy(col));
    thead.appendChild(th);
  });
  updateHeaderSortIcons();
}

function updateHeaderSortIcons() {
  document.querySelectorAll("thead th .sort").forEach(el => el.textContent = "");
  if (!currentSort.key) return;
  const th = [...document.querySelectorAll("thead th")].find(t => t.dataset.col === currentSort.key);
  if (th) th.querySelector(".sort").textContent = currentSort.asc ? "▲" : "▼";
}

function render(rows) {
  const tbody = document.querySelector("tbody");
  tbody.innerHTML = "";
  rows.forEach((row) => {
    const tr = document.createElement("tr");
    COLUMNS.forEach((col) => {
      if (hiddenCols.has(col)) return;
      const td = document.createElement("td");
      td.textContent = fmtNumber(row[col]);
      tr.appendChild(td);
    });
    tbody.appendChild(tr);
  });
  document.getElementById("rowCount").textContent = rows.length.toLocaleString();
}

function sortBy(key) {
  if (currentSort.key === key) {
    currentSort.asc = !currentSort.asc;
  } else {
    currentSort.key = key;
    currentSort.asc = key === guessDefaultSortKey() ? false : true;
  }
  const rows = [...filteredRows()];
  rows.sort((a, b) => {
    const x = a[key];
    const y = b[key];
    const xn = Number(x?.toString().replace(/,/g, ""));
    const yn = Number(y?.toString().replace(/,/g, ""));
    const bothNum = !Number.isNaN(xn) && !Number.isNaN(yn);
    if (bothNum) return currentSort.asc ? xn - yn : yn - xn;
    return currentSort.asc ? String(x).localeCompare(String(y)) : String(y).localeCompare(String(x));
  });
  updateHeaderSortIcons();
  render(rows);
}

function filteredRows() {
  const q = document.getElementById("search").value.trim().toLowerCase();
  const sheet = document.getElementById("sheetFilter").value;
  return DATA.filter((row) => {
    if (sheet && row["__시트"] !== undefined && row["__시트"] !== sheet) return false;
    if (!q) return true;
    return COLUMNS.some((col) => String(row[col] ?? "").toLowerCase().includes(q));
  });
}

function applyFilters() {
  buildHeader(); // rebuild head when hidden columns changed
  const rows = filteredRows();
  if (currentSort.key) {
    const key = currentSort.key;
    const asc = currentSort.asc;
    rows.sort((a, b) => {
      const x = a[key];
      const y = b[key];
      const xn = Number(x?.toString().replace(/,/g, ""));
      const yn = Number(y?.toString().replace(/,/g, ""));
      const bothNum = !Number.isNaN(xn) && !Number.isNaN(yn);
      if (bothNum) return asc ? xn - yn : yn - xn;
      return asc ? String(x).localeCompare(String(y)) : String(y).localeCompare(String(x));
    });
  }
  render(rows);
}

function buildColumnsPanel() {
  const list = document.getElementById("columnsList");
  list.innerHTML = "";
  COLUMNS.forEach(col => {
    const id = "col_" + Math.random().toString(36).slice(2,8);
    const label = document.createElement("label");
    const checkbox = document.createElement("input");
    checkbox.type = "checkbox";
    checkbox.checked = !hiddenCols.has(col);
    checkbox.addEventListener("change", () => {
      if (checkbox.checked) hiddenCols.delete(col);
      else hiddenCols.add(col);
      applyFilters();
    });
    const name = document.createElement("span");
    name.textContent = col;
    label.appendChild(checkbox);
    label.appendChild(name);
    list.appendChild(label);
  });
}

function init() {
  const themeSel = document.getElementById("themeSel");
  themeSel.addEventListener("change", (e) => {
    document.documentElement.setAttribute("data-theme", e.target.value);
  });

  // Sheet filter options
  const sheetColExists = DATA.some(r => Object.prototype.hasOwnProperty.call(r, "__시트"));
  const sheetSelect = document.getElementById("sheetFilter");
  if (sheetColExists) {
    const sheets = Array.from(new Set(DATA.map(r => r["__시트"]))).sort();
    sheets.forEach(s => {
      const opt = document.createElement("option");
      opt.value = s;
      opt.textContent = s;
      sheetSelect.appendChild(opt);
    });
  } else {
    sheetSelect.style.display = "none";
  }

  // Columns panel
  buildColumnsPanel();

  // Default sort guess
  currentSort.key = guessDefaultSortKey();
  currentSort.asc = false;
  applyFilters();

  document.getElementById("search").addEventListener("input", applyFilters);
  sheetSelect.addEventListener("change", applyFilters);
}

window.addEventListener("DOMContentLoaded", init);
